import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './App.css';
import ShopInStore from './components/shopInStore'; // Corrected component import path
import Products from './components/products'; // Corrected component import path
import Contact from './components/contacts'; // Corrected component import path
import Home from './components/home';
import OrderOnline from './components/orders'; // Corrected component import path
import AboutUs from './components/about';
import Account from './components/login';
import Dashboard from './components/dashboard'; // Import Dashboard component
import backgroundImg from './background.PNG';

// Import services.js if needed
// import { login, register } from './services';

function App() {
  // Define any necessary state or functions here

  return (
    <Router>
      <div className="App" style={{ backgroundImage: `url(${backgroundImg})` }}>
        <header>
          <nav>
            <ul>
              <li><Link to="/">Home</Link></li>
              <li><Link to="/about">About</Link></li>
              <li><Link to="/products">Products</Link></li>
              <li><Link to="/contacts">Contact</Link></li>
              <li><Link to="/account">Account</Link></li>
              <li><Link to="/order-online">Order Online</Link></li>
              <li><Link to="/dashboard">Dashboard</Link></li> {/* Add Dashboard link */}
            </ul>
          </nav>
        </header>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<AboutUs />} />
          <Route path="/products" element={<Products />} />
          <Route path="/contacts" element={<Contact />} />
          <Route path="/account" element={<Account />} />
          <Route path="/order-online" element={<OrderOnline />}>
            <Route path="shop-in-store" element={<ShopInStore />} /> {/* Nested Route for ShopInStore */}
          </Route>
          <Route path="/dashboard" element={<Dashboard />} /> {/* Route for Dashboard */}
        </Routes>

      </div>
    </Router>
  );
}

export default App;
